    <g transform="matrix(1.00469, 0, 0, 1.004882, -1.10522, -0.592367)">
      <ng-container *ngFor="let item of lotes">
        <polygon
          [attr.fill]="item.estado == 'disponible' ? green : item.estado == 'publico' ? blue : item.estado == 'reservado' ? orange : red"
          [attr.points]="item.points"
          (click)="openDialog(item)" >
        </polygon>
      </ng-container>

    </g>
  </svg>
</div>

<div fxShow fxHide.gt-sm class="info-container">
  <div fxLayout="column" fxLayoutAlign="center center" fxLayoutGap="20px">
      <mat-card fxFlex fxLaout="row" fxLayoutGap="10px">

      <mat-card fxFlex fxLaout="row" fxLayoutGap="10px">

        <div fxFlex class="texto">Reservado</div>
      </mat-card>

      <mat-card fxFlex fxLaout="row" fxLayoutGap="10px">
        <span fxFlex class="dot" style="background-color: #E74C3C;"></span>
        <div fxFlex class="texto">Indisponible</div>
      </mat-card>

      <mat-card fxFlex fxLaout="row" fxLayoutGap="10px">
        <mat-icon fxFlex class="map-icon" style="color: #E74C3C;">place</mat-icon>
        <div fxFlex class="texto" style="font-size: 10px; white-space: nowrap;">Google Map</div>
      </mat-card>
  </div>
</div>
